import React, { useEffect } from "react";
import { Link } from "react-router-dom";
import "../styles/onboarding.css";

function Onboarding() {
  useEffect(() => {
    const removeBranding = () => {
      const iframe = document.querySelector("iframe");
      if (iframe) {
        const iframeDoc = iframe.contentDocument || iframe.contentWindow.document;
        const branding = iframeDoc.querySelector(".formFooter");
        if (branding) {
          branding.style.display = "none";
        }
      }
    };

    setTimeout(removeBranding, 3000); // Delay to allow iframe to load
  }, []);
  return (
    <div className="about-container">
      <div className="top-nav-container">
        <nav className="top-nav">
          <Link to="/" className="nav-item-black">
            HOME
          </Link>
          <Link to="/services" className="nav-item-black">
            SERVICES
          </Link>
          <Link to="/work" className="nav-item-black">
            OUR WORK
          </Link>
          <Link to="/about" className="nav-item-black">
            ABOUT
          </Link>
          <Link to="/contact" className="nav-item-black">
            CONTACT
          </Link>
        </nav>
        <div className="logo-container">
          <img
            src="/assets/maeknit-no-bg-logo.png"
            alt="Logo"
            className="logo"
          />
        </div>
      </div>

      {/* JotForm Section */}
      <div className="form-section">
        <h2 className="form-header">Get Started with MAEKNIT</h2>
        <p className="form-subtext">
          Fill out the form below to begin your onboarding process.
        </p>

        <div className="jotform-container">
          <iframe
            title="Onboarding Form"
            src="https://form.jotform.com/250766976613166"
            width="100%"
            height="700px"
            frameBorder="0"
            allowFullScreen

          ></iframe>
        </div>
      </div>
    </div>
  );
}

export default Onboarding;
